        "job_description": "Benefits:\n• Retirement Plan\n• 401(k)\n• 401(k) matching\n• Bonus based on performance\n• Company parties\n• Competitive salary\n• Dental insurance\n• Health insurance\n• Opportunity for advancement\n• Paid time off\n• Training & development\n• Vision insurance\n\nJob Description\nSilverthorne Advisory Group is seeking a skilled and highly motivated Software Engineer to join an exciting and growing opportunity within the Defense sector. Using Agile Scrum and Increment development, JavaScript, Web Stacks, Libraries, and Frameworks that use front end technologies you’ll build high performing applications that are customer facing UI and backend API services. You’ll analyze the needs and the environment to make sure the solution you’re developing considers the current architecture and operating environment, as well as future functionality and enhancements. Your expertise in coding, data access layer technologies, and cloud services will be essential in creating a seamless and integrated data experience for our users.\n\nResponsibilities\n• Develop and maintain software applications that handle data access, processing, and analytics.\n• Utilize strong Python coding abilities to build efficient and scalable solutions.\n• Implement and integrate data access layer technologies such as Databricks, iQuery, Global Search, API, and File Browser.\n• Collaborate with Data Scientists and Data Analysts to understand requirements and design efficient front-end solutions.\n• Develop user-friendly, visually appealing tools and interfaces that enable both technical and non-technical users to interact with data effectively.\n• Ensure the security and integrity of data through the implementation of appropriate access controls and encryption mechanisms.\n• Work closely with stakeholders to gather requirements, provide technical guidance, and deliver high-quality solutions.\n• Maintain documentation for software applications, workflows, and processes.\n\nRequirements\n• Secret clearance (can be sponsored).\n• Minimum of 2 years of experience as a Software Engineer or Full Stack Developer, with demonstrated experience supporting, maintaining, and documenting software functionality.\n• Minimum 1 year of experience with programming data entry and complex display applications using React.\n• Minimum 1 year of experience with programming applications to run in a Web environment comprised of Docker Node containers.\n• Proficient with essential front-end technologies like HTML5, CSS3, TypeScript, and JavaScript.\n• Knowledgeable of third-party libraries like React.js, Node.js, Sequelize, jQuery, Angular, and PyTorch.\n• Experience with Node.JS programming at scale or Cloud and GUI design and development.\n• Strong proficiency in Python and SQL coding. Experience with SQL and writing SQL queries, specifically creating complex data retrieval queries and transactional data updates.\n• Experience with SQL databases like MySQL and PostgreSQL.\n• Experience with CI/CD pipelines, especially GitLab.\n• Experience with APIs, especially REST or RPC architectural styles.\n• Experience with secure coding practices, including Static Code Analysis, Container library analysis, or STIGs.\n• Experience with cloud services, particularly AWS including Amazon S3.\n• Experience with automated testing tools to perform testing and maintenance.\n• Strong problem-solving skills and ability to work in a fast-paced, dynamic environment.\n• Excellent communication and collaboration skills, with the ability to work effectively with cross-functional teams.\n• Detail-oriented mindset with a commitment to delivering high-quality results.\n• Must be in the DC Metro area and available to work onsite (Crystal City, VA and Alexandria, VA) as needed.\n• Bachelor's degree in Computer Science or STEM related field.\n\nBenefits\n• Compensation - We carefully consider a wide range of compensation factors, including but not limited to prior experience, skills, expertise, location, and other considerations permitted by law.\n• Healthcare - We offer Health, Vision, and Dental Plans for our employees and their families.\n• Retirement Plan – We invest in your future with a competitive 401(k) plan, where we match 100% of your contributions up to your first 6% and give you access to Vanguard Admiral funds.\n• Paid Time Off - Based on length of service, we offer a generous amount of paid leave.\n• Bonus System – As you invest in us, we invest in you. We offer bonuses to all employees who meet and exceed goals throughout the year.\n• Professional Development – Support for career growth through training programs and certifications.\n• Company Retreats & Team Events – Sponsored trips, team-building activities, and annual conferences related to your skillset.\n\nFlexible work from home options available.",
