        "job_description": "Position: Software Developer I - CMS/WordPress Developer\nLocation: Washington DC (potential for hybrid)\nClearance Required: Public Trust\n\"Must hold an active Public Trust clearance to apply\"\n\nThis position will build application and web front-ends based on requirements from Stakeholder Engagement, programs, UX and designers.\n\nSCOPE OF WORK\nThe position's SCOPE OF WORK include the following:\n• * Experience with WordPress CMS framework, configuration and maintenance\n• Create organizational website with WordPress framework\n• Write/develop templates with Wordpress CMS and PHP.\n• Experience with configuring WordPress in-house environment and maintenance.\n• Build reusable code and component/pattern libraries\n• Skilled in HTML5, CSS, CSS3, SCSS.\n• Skilled in Front-End development framework and process from UX design to web component delivery.\n• Proficient understanding of client-side scripting and JavaScript frameworks, including jQuery.\n• Some combination of JavaScript frameworks, such as DurandaJS, Angular, Gulp, Webpack, ReactJS.\n• Experience creating accessible forms (using ARIA), with client-side form validation (JavaScript).\n• Experience with Bootstrap or other similar technologies.\n• Experience with a collaboration platform and code repository control.\n• Build reusable code and libraries for future use.\n• Ensure the technical feasibility of UI/UX designs.\n• Optimize application for maximum speed and scalability.\n• A commitment to Lean principles, including rapid prototyping for user testing.\n• Good understanding of asynchronous request handling, partial page updates, and AJAX\n• Baseline understanding of server-side CSS pre-processing platforms, such as LESS and SASS\n• Baseline understanding of WCAG compliance as it applies to front-end code\n• Basic knowledge of image authoring tools, to be able to crop, resize, or perform small adjustments on an image. Familiarity with tools such as Gimp or Photoshop is a plus.\n• Proficient understanding of cross-browser compatibility issues and ways to work around them.\n• Good understanding of SEO principles and ensuring that application will adhere to them.\n• Responsible for support of critical business functions through the development, implementation, and maintenance of web front ends, including adaptation of COTS products to meet the business requirements.\n• Lead and Contribute web front end expertise to multiple projects and ensure that specifications are met.\n• Design, code, test, debug, maintain, and document web front end customizations. Participate in peer-reviews.\n• Follow established accessibility and W3C standards and procedures. Contribute towards the improvement.\n• Work as part of web development teams across enterprise\n• Coordinate with departments and users in the support of business applications.\n• Exercise judgment to plan and accomplish goals.\n• Represent the IT department in terms of front-end development expertise in coordination with other departments.\n• Perform other duties, as assigned.\n\nQUALIFICATION AND EXPERIENCE:\n• * WordPress framework, CMS, PHP 4-6 Years\n• XML, JavaScript, CSS, HTML, HTML5 4-6 Years\n• Accessibility standards and tools (ARIA) 2-3 Years\n• Web Services, ReactJS, Angular, Angular2, Webpack, Gulp 1-2 Years\n• Bootstrap (or similar platform) 1-2 Years\n• Technical Documentation 4-6 Years\n\nSPECIAL SKILLS :\n• * Analytical and problem-solving skills. Ability to develop solutions to problems\n• Ability to lead and conduct design reviews, code reviews and technical assessment\n• Developing and/or creating new or more effective ideas, approaches, etc.\n• Developing and formulating short-range plans/decisions\n• Excellent interpersonal and communication skills",
