        "job_description": "Our financial services client in McLean, VA is looking for a Front End Developer to join their team. This is 6 month onsite engagement, 40 hours/week, with potential extend.\n\nFront End Developer Responsibilities\n• Translate wireframes, comps, and high-level requirements into functional, performant, responsive, production-ready markup\n• Collaborate with a team of UX, UI, designers, writers, and marketing staff to design and develop wireframes, prototypes, and requirements\n• Develop reusable components and user-facing features to enhance user engagement and site functionality\n• Design, develop, and integrate front-end Drupal modules in a multi-site environment\n• Write and maintain technical documentation, including design documents and user manuals\n• Participate in code reviews to ensure that code is developed in accordance with best practices and standards\n• Update or add new features to existing web projects by implementing clean, semantic reusable code/libraries, and provide guidelines for others to follow\n• Optimize components for maximum performance across a wide array of web-capable devices and browsers\n• Present proposed solutions, structures, and designs to a non-technical audience including marketing teams, senior management, designers, and project stakeholders\n\nFront End Developer Qualifications\n• 5+ years of web development experience in professional environment - financial services or governement exp preferred\n• Advanced Drupal 11 experience - Ability to build front-end Drupal environments and manage compilers\n• Knowledge of PHP and managing the Drupal theme layer\n• Highly proficient in layout and design: Twig, HTML5, CSS3/SCSS, responsive/mobile-first design\n• Highly proficient in client-side scripting: JavaScript (ES6+), AJAX, and JQuery\n• Crisp written and verbal communication skills, with a client-facing professional demeanor\n• Strong understanding of web standards, information design, and best practices for accessibility, usability, and SEO\n• Experience with code version control tools like Git or Bitbucket, and CMS\n• Experience with project management tools such as Jira, Confluence, Wrike\n• Familiarity with the Software Development Lifecycle and exposure to Agile\n• Portfolio or showcase of previous work (websites, open-source contribution, personal projects)\n• Experience working with design systems\n• Experience with Google Marketing Platform (Google Analytics, GTM, Data Layer)\n\nIn this position, you may have access to client or customer systems, confidential and/or proprietary information or data, including financial information. This position is onsite and requires you to work closely with other individuals in a collaborative team environment.\n\nBenefits\n\nCreative Circle's Freelance Employee benefits package includes eligibility for Minimum Essential Coverage (MEC) medical plan, dental/vision/term life package, discount prescription program, critical illness, accident, tele-behavioral health, and 401(k) plan. Sick leave is provided to Candidates whose assignment work location is in a state or city subject to sick leave laws. A Minimum Value (MV) PPO medical plan, Employee Stock Purchase Plan, and paid holiday eligibility are based on length and dates of service.\n\nEmail Your Resume In Word To\n\nLooking forward to receiving your resume through our website and going over the position with you. Clicking apply is the best way to apply, but you may also:\n\ncameron.little@jobalert.creativecircle.com\n• Please do NOT change the email subject line in any way. You must keep the JobID: linkedin : CL9-1870972 -- in the email subject line for your application to be considered.***\n\nCameron Little - Senior Recruiter\n\nFor Creative Circle to represent you for this opportunity, you must be currently authorized to work in the United States without the need of employer sponsorship for a non-immigrant visa such as a H-1B, TN, or O visa. We do not support or provide training for STEM/OPT programs. Additionally, you must be physically located in and perform the work for our client in the United States.\n\nThis job was first posted by Creative Circle on 07/17/2025 and applications will be accepted on an ongoing basis until the position is filled or closed.\n\nCreative Circle is an Equal Opportunity Employer\n\nAll qualified applicants will receive consideration for employment without regard to race, color, creed, religion, sex (including pregnancy, childbirth, breastfeeding, or related medical conditions), age, sexual orientation, gender identity or expression, national origin, ancestry, citizenship, genetic information, registered domestic partner status, marital status, disability, status as a crime victim, protected veteran status, or any other characteristic protected by law. Creative Circle will consider qualified applicants with criminal histories in a manner consistent with the requirements of applicable state and local law, including but not limited to the Los Angeles County Fair Chance Ordinance, the San Francisco Fair Chance Ordinance, and the California Fair Chance Act. If you need a reasonable accommodation in the application process, please contact your Recruiter (the person you'll be interviewing with) or a member of our Human Resources team to make arrangements. United Healthcare creates and publishes the Transparency in Coverage Machine-Readable Files on behalf of Creative Circle.\n\n,",
