        "job_description": "Job Description BAE Systems is looking for a Cloud Developer to support a Cloud-based (AWS) mission critical system for our Federal Customer. As the Cloud Developer, you will work with various technical and engineering teams to design, develop, implement, optimize and maintain Cloud-based solutions. We are looking for Cloud Developer with demonstrated experience developing in AWS Cloud, building highly scalable and fault tolerant Cloud infrastructure and DevOps pipeline and building them from the ground up. Candidate must have strong experience with agile delivery practices in a federal setting.\n\nResponsibilities include:\n• Design, develop and maintain software on cloud platforms (AWS)\n• Ability to deliver software and software builds and releases (which includes the design, development, support of builds, scripts, and installation procedure)\n• Implement dynamically scalable and highly available services on cloud platforms (AWS) and deploy production systems\n• Create and manage CI/CD pipelines\n• Automate processes required to deploy, manage, configure, scale, and monitor internal, product and cloud-based applications following best practices\n• Provide Java service development with Spring Framework, ideally Spring Boot and Spring Data/JPA\n• Ability to conduct automated unit/integration testing with JUnit, Jest, React Test Library\nRequired Education, Experience, & Skills\n• Bachelor's degree in Computer Science, Information Systems or other equivalent technical fields.\n• 8 - 10 years of experience in a technical discipline supporting large scale Cloud infrastructure initiatives and projects.\n• Demonstrated experience designing, developing and maintaining Cloud-based solutions.\n• Experience with continuous integration and continuous delivery practices, CI/CD pipelines\n• React, Redux, and front-end experience (CSS frameworks)\n• Experience building for Section 508 compliance and accessibility\n• REST API experience\n• Experience with containerized application delivery, ideally Kubernetes and AWS\n• Automated unit/integration testing with JUnit, Jest, React Test Library\n• Solid engineering fundamentals, troubleshooting, and problem solving skills\nPreferred Education, Experience, & Skills Cloud Certification\n\nPay Information\nFull-Time Salary Range: $115779 - $196825\n\nPlease note: This range is based on our market pay structures. However, individual salaries are determined by a variety of factors including, but not limited to: business considerations, local market conditions, and internal equity, as well as candidate qualifications, such as skills, education, and experience.\n\nEmployee Benefits: At BAE Systems, we support our employees in all aspects of their life, including their health and financial well-being. Regular employees scheduled to work 20+ hours per week are offered: health, dental, and vision insurance; health savings accounts; a 401(k) savings plan; disability coverage; and life and accident insurance. We also have an employee assistance program, a legal plan, and other perks including discounts on things like home, auto, and pet insurance. Our leave programs include paid time off, paid holidays, as well as other types of leave, including paid parental, military, bereavement, and any applicable federal and state sick leave. Employees may participate in the company recognition program to receive monetary or non-monetary recognition awards. Other incentives may be available based on position level and/or job specifics.\nAbout BAE Systems Intelligence & Security BAE Systems, Inc. is the U.S. subsidiary of BAE Systems plc, an international defense, aerospace and security company which delivers a full range of products and services for air, land and naval forces, as well as advanced electronics, security, information technology solutions and customer support services. Improving the future and protecting lives is an ambitious mission, but it’s what we do at BAE Systems. Working here means using your passion and ingenuity where it counts – defending national security with breakthrough technology, superior products, and intelligence solutions. As you develop the latest technology and defend national security, you will continually hone your skills on a team—making a big impact on a global scale. At BAE Systems, you’ll find a rewarding career that truly makes a difference.\n\nIntelligence & Security (I&S), based in McLean, Virginia, designs and delivers advanced defense, intelligence, and security solutions that support the important missions of our customers. Our pride and dedication shows in everything we do—from intelligence analysis, cyber operations and IT expertise to systems development, systems integration, and operations and maintenance services. Knowing that our work enables the U.S. military and government to recognize, manage and defeat threats inspires us to push ourselves and our technologies to new levels.\n\nThis position will be posted for at least 5 calendar days. The posting will remain active until the position is filled, or a qualified pool of candidates is identified.",
