        "job_description": "TMC Technologies is seeking a SharePoint Developer to join our team in Washington, D.C.Due to contract regulations you will need an active Top Secret clearance to be considered. The SharePoint Developer will be responsible for:\n\nContractor shall develop web parts, features, SP Apps, InfoPath forms, timer jobs, and applications for SharePoint Subscription Edition (SE) and/or Office 365/SharePoint Online.\n\nContractor shall develop server-side code using .NET technologies with VB.net, C# and/or ASP.NET.\n\nContractor shall develop client-side code for web applications using HTML, jQuery, JavaScript, CSS, PHP and other technologies.\n\nContractor shall leverage web services to access data from other systems.\n\nContractor shall use strong communications and interpersonal skills.\n\nContractor shall leverage excellent problem solving, design, coding and debugging skills.\n\nContractor shall provide critical thinking, problem solving, design, and most critically attention to performance, scalability, reliability, availability, at the system and component level.\n\nContractor shall work within an Agile based development process.\n\nContractor shall use in-depth understanding of SharePoint Subscription Edition (SE) and SharePoint Online to solve technical and business problems.\n\nContractor shall participate in other non-client projects that support IOP goals and objectives (internal initiatives, prototypes, etc.).\n\nProvide advice, guidance, and knowledge transfer for managing technical solutions in ways to avoid common support issues and decrease the likelihood of system outages.\n\nJob Requirements\n\nContractor shall work up to 100% of the time and may work off-site in a DC location\n\nContractor shall possess a DoD Active Top Secret (TS) Clearance. Contractor shall have the ability to obtain and maintain a SCI.\n\nContractor shall have at least 8 years of professional IT development experience\n\nContractor shall have at least 3 years' experience using .NET technologies with VB.net, C# and/or ASP.NET\n\nContractor shall have at least 1-2 years' experience developing applications for SharePoint 2013 using the SharePoint object models\n\nContractor shall understand various types of life cycle development including Agile/Scrum lifecycles\n\nPreferred Experience\n\nPreferred that the contractor has previous FBI experience.\n\nPreferred experience creating and consuming Web Services.\n\nPreferred InfoPath and Forms Services experience.\n\nPreferred SQL Server and 2012 Reporting Services and Integration Service experience.\n\nPreferred .NET 4.0+ experience.\n\nPreferred windows workflow foundation experience.\n\nPreferred Microsoft certifications.\n\nBS/BA degree in computer science or a related field.\n\nWe are equal opportunity/affirmative action employers, committed to diversity in the workplace. All qualified applicants will receive consideration for employment without regard to race, color, religion, sex, gender identity, sexual orientation, national origin, disability, or protected veteran status, or any other protected characteristic under state or local law.",
