        "job_description": "Dice is the leading career destination for tech experts at every stage of their careers. Our client, System One, is seeking the following. Apply via Dice today!\n\nAtlassian Developer\n\nTS/SCI Clearance is required\n\nHybrid 2-3 days a week in Arlington or Alexandria\n\nSalary: $140,000-$180,000/year\n\nWe are seeking a highly skilled Atlassian JIRA & Confluence Specialist to design, administer, and optimize our Atlassian platforms. The ideal candidate will have a strong technical background and proven experience in workflow design, automation, and integration, leveraging a broad toolkit to enable team success.\n\nKey Responsibilities\n\nConfigure and administer user directories with LDAP for authentication and authorization within JIRA and Confluence.\n\nDesign, code, and maintain custom workflows using ScriptRunner, REST API integrations, and native Atlassian features.\n\nDevelop and integrate solutions using Java, JavaScript, HTML, and Python.\n\nAdminister, support, and extend JIRA and Confluence, including advanced workflow design (2+ years experience required).\n\nIntegrate Atlassian tools with CI/CD pipelines, particularly with GitLab.\n\nRead, analyze, and reverse engineer existing coded workflows to determine functionality and recommend improvements.\n\nGather, analyze, and document user requirements and translate them into technical solutions.\n\nProvide user support, training, and troubleshooting for JIRA and Confluence.\n\nCreate and maintain technical documentation for workflows, integrations, and administrative procedures.\n\nCollaborate with cross-functional teams to optimize processes and tool usage.\n\nAbility to troubleshoot technical issues and functionality independently.\n\nRequired Skills & Qualifications\n\nDemonstrated experience (2+ years) with ScriptRunner for JIRA/Confluence, including writing Groovy scripts and custom workflow functions.\n\nStrong proficiency (3+ years) in Java, JavaScript, and HTML; proficiency in Python.\n\nExperience integrating Atlassian products with LDAP for user management.\n\nHands-on experience with REST API development and integrations.\n\nExperience with CI/CD processes and pipelines, specifically with GitLab.\n\nAbility to leverage technical skills in administration, coding, and workflow design within JIRA and Confluence.\n\nProven ability to gather requirements from business users and translate into actionable technical solutions.\n\nAbility to read, interpret, and reverse engineer existing workflows and scripts.\n\nExcellent communication, documentation, and collaboration skills.\n\nNice to Have\n\nAtlassian certifications (e.g., ACP-120, ACP-100).\n\nExperience With Additional Atlassian Tools (Bitbucket, Bamboo).\n\nFamiliarity with Agile and Scrum methodologies.\n\nSystem One, and its subsidiaries including Joul, ALTA IT Services, and Mountain Ltd., are leaders in delivering outsourced services and workforce solutions across North America. We help clients get work done more efficiently and economically, without compromising quality. System One not only serves as a valued partner for our clients, but we offer eligible employees health and welfare benefits coverage options including medical, dental, vision, spending accounts, life insurance, voluntary plans, as well as participation in a 401(k) plan.\n\nSystem One is an Equal Opportunity Employer. All qualified applicants will receive consideration for employment without regard to race, color, religion, sex (including pregnancy, childbirth, or related medical conditions), sexual orientation, gender identity, age, national origin, disability, family care or medical leave status, genetic information, veteran status, marital status, or any other characteristic protected by applicable federal, state, or local law.\n\n#M- M2\n\nRF1\n\n#DI- RF1\n\nRef: #850-Rockville (ALTA IT)",
